import {useParams} from "react-router-dom";
import {useEffect} from "react";
function Detail() {
  // const {id} = useParams();
  const getMovie = async() => {
    const json = await (
      await fetch(
        "https://yts.mx/api/v2/list_movies.json?minimum_rating=8.5&sort_by=year")
    ).json();
    console.log(json);
  }

  useEffect(() => {
    getMovie();
  }, []);

  return <h1>Detail</h1>;
}

export default Detail;
